import React from 'react';
const Footer = () => (
    <footer id="sticky-footer" class="py-4 bg-dark text-white-50">
    <div class="container text-center">
      <small>QueueUp &copy; Your Website</small>
    </div>
  </footer>

);
export default Footer;
